import React, { Component } from "react";
import styled from "styled-components";

const Container = styled.div``;

function Home({ ws }) {
  return (
    <Container className="dark-container ">
      <div>Welcome home</div>
      <button>Join Room</button>
    </Container>
  );
}

export default Home;
